import React from "react"

class Users extends React.Component {
    users = [
        {
            id: 1,
            firstname: 'Bob',
            surname: 'Marley',
            bio: 'Bob\'s bio',
            age: 40,
            isHappy: true,
        },
        {
            id: 2,
            firstname: 'John',
            surname: 'Doe',
            bio: 'John\'s bio',
            age: 22,
            isHappy: false,
        },
    ]
    render() {
        return (
            <div>
                {this.users.map((el) => (
                    <div>
                        <h3>{el.firstname} {el.surname}</h3>
                        <p>{el.bio}</p>
                    </div>
                ))}
            </div>
        )
    }
}

export default Users
